import React from 'react'

import { TableCell, TableRow } from '@mui/material'

import './Week.css'

type AppProps = {
    week: Date[],
    key: number
}

export default function Week({week, key}: AppProps) {
  return (
        <>
            <tr>
                {week.map((day: Date): any => {
                    // return <TableCell align='center' padding='none' key={key}>
                    //     {
                    //         // <Fab sx={{borderRadius: 8}}>
                    //         //     { day.getDate() }
                    //         // </Fab>
                    //         <button className='dateButton'>
                    //             { day.getDate() }
                    //         </button>
                    //     }
                    // </TableCell>

                    return <td>
                        <button className='dateButton'>
                            { day.getDate() }
                        </button>
                    </td>
                })}
            </tr>
        </>
    )
}
